import React from 'react';
import Navbar from './navbar.js';

function Dashboard() {
  return (
    <div className="h-screen bg-purple flex justify-center items-center">
      <Navbar />
      <div className="w-5/6 h-5/6 bg-darkgrey rounded-xl shadow-2xl p-8 flex justify-center items-baseline">
            <div class="flex justify-between items-baseline">
              <div class="w-72 h-64 bg-silver shadow-2xl"></div>
              <div class="w-72 h-64 bg-silver shadow-2xl"></div>
              <div class="w-72 h-64 bg-silver shadow-2xl"></div>
            </div>
      </div>
    </div>
  );
}

export default Dashboard;
